import React from 'react'
import IMAGES from './images/imag';
import {Link } from 'react-router-dom';
import { useNavigate } from 'react-router-dom';
import { Navbar, Nav, Button } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import Container from 'react-bootstrap/Container';
import NavDropdown from 'react-bootstrap/NavDropdown';
import './App.css';
 
const Navi = () => {
        const navigate = useNavigate();
      
        const handleSignInClick = () => {
          navigate('/Register');
        };
  return (
    <div>
       <Navbar bg="dark" expand="lg"
                variant="dark"
                className="container-fluid">
                  <div className="logo-container">
                <img
                    src={IMAGES.img1}
                    className="logo img-fluid"
                    alt="Logo"
                    width="60" height="60"
                />
            </div>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
                <Nav className="mr-auto">
                    <Nav.Link href="/" style={{ fontSize: '2.25rem' }}>
                        Home
                    </Nav.Link>
                    <Nav.Link href="/Features" style={{ fontSize: '2.25rem' }}>
                        Features
                    </Nav.Link>
                    <Nav.Link href="/Explore" style={{ fontSize: '2.25rem' }}>
                        Explore
                    </Nav.Link>
                </Nav>
                <Button variant="primary" className="fs-4" onClick={handleSignInClick}>Register</Button>
            </Navbar.Collapse>
            
        </Navbar>
        </div>
  )
}

export default Navi;
